import React from 'react';
import './App.css';
import List from "./components/List";

function App() {
  return (
    <div>
      <h1>International Phone Number Categorize</h1>
        <input type="text" placeholder={"Country here"}/>
        <select name="state">
          <option value={1}>
            Valid
          </option>
          <option value={0}>
            Invalid
          </option>
        </select>
      <div>
        <span> COUNTRY NAME </span>
        <span> COUNTRY CODE </span>
        <span> PHONE NUMBER </span>
        <span> STATE </span>
      </div>

      <List/>


    </div>
  );
}

export default App;
